import styled from "styled-components";

const Tag = styled.div`
  border: 1px solid black;
  padding: 10px 20px;
  margin: 8px 8px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
`;
const Div = styled.div`
  display: flex;
  flex-direction: column;
`;
console.log(Tag, Div);
export default function Tags(props) {
    return (
        <Tag>
            <Div>
                <p>{props.name}</p>
                <div>{props.tag}</div>
            </Div>
            <div>开始</div>
        </Tag>
    )
}
